import "./App.css";
import { Container } from "react-bootstrap";
import Header from "./components/Header.js";
import Footer from "./components/Footer";

import React from "react";

function App() {
  return (
    <div>
      <Header />
      <main>
        <Container>
          <h1>Welcome to Storella</h1>
        </Container>
      </main>
      <Footer />
    </div>
  );
}

export default App;
